measurements.description:
Two hundred seventy-six flowers and 516 buds on 12 inflorescences up to 32cm in length;

	sepals and petals chartreuse boldly marked dark cordovan coalescent blotches;

	lip yellow-green sidelobes overlaid brown stripes fusing to solid distally, midlobe yellow overlaid brown basally, bright yellow distally; 
	column light green weakly overlaid brown spots, anther cap yellow;
	 substance firm; texture matte.
